import React from "react";

function Rate_Item(props) {
  return (
    <div className="col-5">
      <div
        class="badge bg-black rounded-circle"
        style={{ height: "3rem", width: "3rem" }}
      >
        <div class="mt-3">{props.img}</div>
      </div>
      <div className="col">
         </div>
      
    </div>
  );
}

export default Rate_Item;
